*Hello*
Thanks to <@joeythomaschaske> you can now *plus*, *minus* and *keep score* of all the *good* and *not so good* things your friends say and do on Slack.

*How*
```@user++   (awards a point)
@user--   (deducts a point)
@PlusPlus leaderboard   (shows the score)
@PlusPlus help          (view help options) ```
*Try*
Someone  give <@joeythomaschaske> a ++

